import React from "react";
import styled from 'styled-components';

const Navbar = () => {

  return <>
    <Header>
      <h1>Park Games</h1>
      <nav>
        <h2>Home</h2>
        <h2>Sign Up</h2>
        <h2>Login</h2>
      </nav>


    </Header>

  </>

}

export default Navbar;

const Header = styled.nav`
background: white;

h1 {
  text-align: center;
}
h2 {
  text-align: center;
  padding: 0 20px 0 20px;
  font-size: 1.1rem;

}
nav{
  display: flex;
  justify-content: center;
}



`
